-- ----------------------------
-- Procedure structure for p_statistics_current_all
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_statistics_current_all`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_statistics_current_all`(IN v_customer_id varchar(255))
BEGIN
SET @customerId =  v_customer_id; 
select value from t_param where kv='use_time' LIMIT 1 into @duration;
select count(r.id) as duration_time  from t_record r
INNER JOIN t_customer_device cd ON cd.id=r.customer_device_id
where cd.customer_id=@customerId;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for p_statistics_current_day
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_statistics_current_day`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_statistics_current_day`(IN v_customer_id varchar(255))
BEGIN
SET @customerId =  v_customer_id ;  
set @today=DATE_FORMAT(NOW(), '%Y-%m-%d' ); 
select value from t_param where kv='use_time' LIMIT 1 into @duration;
select cd.device_id,r.use_time,@duration as duration_time from t_record r
INNER JOIN t_customer_device cd ON cd.id=r.customer_device_id
where cd.customer_id=@customerId
and 	r.use_time >= CONCAT(@today,' 00:00:00') AND r.use_time <= CONCAT(@today,' 23:59:59')
order by  r.use_time desc;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for p_statistics_current_month
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_statistics_current_month`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_statistics_current_month`(IN v_customer_id varchar(255))
BEGIN
SET @customerId =  v_customer_id ;
SET @firstday=DATE_FORMAT(date_add(curdate(), interval - day(curdate()) + 1 day),'%Y-%m-%d' );
set @lastday=DATE_FORMAT(last_day(curdate()),'%Y-%m-%d' );
select value from t_param where kv='use_time' LIMIT 1 into @duration;
select a.week as use_no,count(a.id)*@duration as duration_time from 
(
select ((DAY(r.use_time)+WEEKDAY(r.use_time-INTERVAL DAY(r.use_time) DAY)) DIV 7 + 1) as week, r.id  from t_record r
INNER JOIN t_customer_device cd ON cd.id=r.customer_device_id
where  cd.customer_id=@customerId
and r.use_time >= CONCAT(@firstDay,' 00:00:00') AND r.use_time <= CONCAT(@lastday,' 23:59:59')
) a group by week;

END
;;
DELIMITER ;

