-- ----------------------------
-- Procedure structure for p_statistics_current_week
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_statistics_current_week`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_statistics_current_week`(IN v_customer_id varchar(255))
BEGIN
SET @customerId =  v_customer_id ;  
set @today=DATE_FORMAT(NOW(), '%Y-%m-%d' );
set @firstDay=DATE_FORMAT(date_sub(curdate(),INTERVAL WEEKDAY(curdate()) + 1 DAY),'%Y-%m-%d' ); 
select value from t_param where kv='use_time' LIMIT 1 into @duration;
select a.week_day as use_no,count(a.id)*@duration as duration_time from 
(select date_format(r.use_time,'%w') as week_day, r.id from t_record r
INNER JOIN t_customer_device cd ON cd.id=r.customer_device_id
where cd.customer_id=@customerId
and r.use_time >= CONCAT(@firstDay,' 00:00:00') AND r.use_time <= CONCAT(@today,' 23:59:59')
) a group by week_day;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for p_statistics_month
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_statistics_month`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_statistics_month`()
BEGIN
declare  nowDay varchar(36);
SELECT DATE_FORMAT(NOW(), '%Y-%m-%d' ) into nowDay; 
set @lastMonth=DATE_FORMAT(date_sub(NOW(),interval 1 MONTH), '%Y-%m' ); 
set @days=DAYOFMONTH(LAST_DAY(CONCAT(@lastMonth,'-','01')));
set @i = 1;
Set @j=0;

while @i<=@days DO 
     set @weekday=WEEKDAY(CONCAT(@lastMonth,'-',@i)); -- 循环开始
     IF @weekday = 6 
      THEN  
       set @j=@j+1;
        -- 周日是第一天
       set @startDay=CONCAT(@lastMonth,'-',@i);
       -- 周六是最后一天
			 set @endDay=DATE_FORMAT(date_add(str_to_date(@startDay,'%Y-%m-%d'),interval 6 day),'%Y-%m-%d');
							SELECT
								replace(uuid(), '-', '') as id,cd.customer_id ,@j as week, COUNT(r.id) as count
							FROM
									t_record r
									INNER JOIN  t_customer_device cd ON  r.customer_device_id = cd.id
							WHERE
									r.user_time >= CONCAT(@startDay,' 00:00:00') AND r.user_time <= CONCAT(@endDay,' 23:59:59')
							GROUP BY
									cd.customer_id;
   
		 END IF;  
     set @i=@i+1;
end while;

END
;;
DELIMITER ;

